                FileName = fileName;
                ImageBytes = imageBytes;
                Reference = reference;
                Mvid = mvid;
            }

            public void Deconstruct(out string fileName, out byte[] imageBytes, out PortableExecutableReference reference, out Guid mvid)
            {
                fileName = FileName;
                imageBytes = ImageBytes;
                reference = Reference;
                mvid = Mvid;
